  };

  const validateForm = () => {
    const newErrors: {[key: string]: string} = {};

    if (!formData.username.trim()) {
      newErrors.username = 'ËØ∑ËæìÂÖ•Áî®Êà∑Âêç';
    } else if (formData.username.length < 2) {
      newErrors.username = 'Áî®Êà∑ÂêçËá≥Â∞ë2‰∏™Â≠óÁ¨¶';
    }

    if (!formData.email.trim()) {
      newErrors.email = 'ËØ∑ËæìÂÖ•ÈÇÆÁÆ±Âú∞ÂùÄ';
    } else if (!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(formData.email)) {
      newErrors.email = 'ËØ∑ËæìÂÖ•ÊúâÊïàÁöÑÈÇÆÁÆ±Âú∞ÂùÄ';
    }

    if (!formData.phone.trim()) {
      newErrors.phone = 'ËØ∑ËæìÂÖ•ÊâãÊú∫Âè∑Á†Å';
    } else if (!/^1[3-9]\d{9}$/.test(formData.phone)) {
      newErrors.phone = 'ËØ∑ËæìÂÖ•ÊúâÊïàÁöÑÊâãÊú∫Âè∑Á†Å';
    }

    if (!formData.password) {
      newErrors.password = 'ËØ∑ËæìÂÖ•ÂØÜÁ†Å';
    } else if (formData.password.length < 6) {
      newErrors.password = 'ÂØÜÁ†ÅËá≥Â∞ë6‰∏™Â≠óÁ¨¶';
    }

    if (!formData.confirmPassword) {
      newErrors.confirmPassword = 'ËØ∑Á°ÆËÆ§ÂØÜÁ†Å';
    } else if (formData.password !== formData.confirmPassword) {
      newErrors.confirmPassword = '‰∏§Ê¨°ËæìÂÖ•ÁöÑÂØÜÁ†Å‰∏ç‰∏ÄËá¥';
    }

    if (!formData.agreeTerms) {
      newErrors.agreeTerms = 'ËØ∑ÂêåÊÑèÊúçÂä°Êù°Ê¨æÂíåÈöêÁßÅÊîøÁ≠ñ';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    if (!validateForm()) {
      return;
    }

    setIsLoading(true);

    // Ê®°ÊãüÊ≥®ÂÜåËØ∑Ê±Ç
    setTimeout(() => {
      setIsLoading(false);
      alert('Ê≥®ÂÜåÂäüËÉΩÊ≠£Âú®ÂºÄÂèë‰∏≠ÔºåÊï¨ËØ∑ÊúüÂæÖÔºÅ');
    }, 1500);
  };

  const handleSocialRegister = (provider: string) => {
    alert(`${provider}Ê≥®ÂÜåÂäüËÉΩÊ≠£Âú®ÂºÄÂèë‰∏≠ÔºåÊï¨ËØ∑ÊúüÂæÖÔºÅ`);
  };

  return (
    <div className="auth-page">
      <div className="auth-container">
        <div className="auth-content">
          {/* Â∑¶‰æß‰ø°ÊÅØ */}
          <div className="auth-info">
            <div className="auth-info-content">
              <h2>Âä†ÂÖ•Êàë‰ª¨</h2>
              <p>ÂºÄÂêØÂ≠©Â≠êÁöÑÁºñÁ®ãÂ≠¶‰π†‰πãÊóÖ</p>
              <div className="auth-features">
                <div className="feature">
                  <div className="feature-icon">
                    <div className="icon-circle">
                      <span>üéØ</span>
                    </div>
                  </div>
                  <div className="feature-text">
                    <h4>‰∏™ÊÄßÂåñÂ≠¶‰π†</h4>
                    <p>Ê†πÊçÆÂ≠©Â≠êÁöÑËÉΩÂäõÂÆöÂà∂Â≠¶‰π†ËÆ°Âàí</p>
                  </div>
                </div>
                <div className="feature">
                  <div className="feature-icon">
                    <div className="icon-circle">
                      <span>üèÜ</span>
                    </div>
                  </div>
                  <div className="feature-text">
                    <h4>ÊàêÂ∞±Á≥ªÁªü</h4>
                    <p>ÂÆåÊàê‰ªªÂä°Ëé∑ÂæóÂæΩÁ´†ÂíåÂ•ñÂä±</p>
                  </div>
                </div>
                <div className="feature">
                  <div className="feature-icon">
                    <div className="icon-circle">
                      <span>üë•</span>
                    </div>
                  </div>
                  <div className="feature-text">
                    <h4>Á§æÂå∫‰∫§ÊµÅ</h4>
                    <p>‰∏éÂÖ∂‰ªñÂ∞èÊúãÂèãÂàÜ‰∫´‰ΩúÂìÅÂíåÁªèÈ™å</p>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* Âè≥‰æßÊ≥®ÂÜåË°®Âçï */}
          <div className="auth-form-section">
            <div className="auth-form-container">
              <div className="auth-header">
                <h1>ÂàõÂª∫Ë¥¶Êà∑</h1>
                <p>Â°´ÂÜô‰ø°ÊÅØÂÆåÊàêÊ≥®ÂÜåÔºåÂºÄÂßãÂ≠¶‰π†‰πãÊóÖ</p>
              </div>

              {/* Á¨¨‰∏âÊñπÊ≥®ÂÜå */}
              <div className="social-login">
                <button 
                  className="social-btn wechat"
                  onClick={() => handleSocialRegister('ÂæÆ‰ø°')}
                >
                  <MessageCircle size={20} />
                  <span>ÂæÆ‰ø°Ê≥®ÂÜå</span>
                </button>
                <button 
                  className="social-btn alipay"
                  onClick={() => handleSocialRegister('ÊîØ‰ªòÂÆù')}
                >
                  <Smartphone size={20} />
                  <span>ÊîØ‰ªòÂÆùÊ≥®ÂÜå</span>
                </button>
              </div>

              <div className="divider">
                <span>Êàñ‰ΩøÁî®ÈÇÆÁÆ±Ê≥®ÂÜå</span>
              </div>

              {/* Ê≥®ÂÜåË°®Âçï */}
              <form onSubmit={handleSubmit} className="auth-form">
                <div className="form-group">
                  <label htmlFor="username">Áî®Êà∑Âêç</label>
                  <div className="input-wrapper">
                    <User className="input-icon" size={20} />
                    <input
                      type="text"
                      id="username"
                      name="username"
                      value={formData.username}
                      onChange={handleInputChange}
                      placeholder="ËØ∑ËæìÂÖ•Áî®Êà∑Âêç"
                      className={errors.username ? 'error' : ''}
                    />
                  </div>
                  {errors.username && <span className="error-message">{errors.username}</span>}
                </div>

                <div className="form-group">
                  <label htmlFor="email">ÈÇÆÁÆ±Âú∞ÂùÄ</label>
                  <div className="input-wrapper">
                    <Mail className="input-icon" size={20} />
                    <input
                      type="email"
                      id="email"
                      name="email"
                      value={formData.email}
                      onChange={handleInputChange}
                      placeholder="ËØ∑ËæìÂÖ•ÈÇÆÁÆ±Âú∞ÂùÄ"
                      className={errors.email ? 'error' : ''}
                    />
                  </div>
                  {errors.email && <span className="error-message">{errors.email}</span>}
                </div>

                <div className="form-group">
                  <label htmlFor="phone">ÊâãÊú∫Âè∑Á†Å</label>
                  <div className="input-wrapper">
                    <Phone className="input-icon" size={20} />
                    <input
                      type="tel"
                      id="phone"
                      name="phone"
                      value={formData.phone}
                      onChange={handleInputChange}
                      placeholder="ËØ∑ËæìÂÖ•ÊâãÊú∫Âè∑Á†Å"
                      className={errors.phone ? 'error' : ''}
                    />
                  </div>
                  {errors.phone && <span className="error-message">{errors.phone}</span>}
                </div>

                <div className="form-group">
                  <label htmlFor="password">ÂØÜÁ†Å</label>
                  <div className="input-wrapper">
                    <Lock className="input-icon" size={20} />
                    <input
                      type={showPassword ? 'text' : 'password'}
                      id="password"
                      name="password"
                      value={formData.password}
                      onChange={handleInputChange}
                      placeholder="ËØ∑ËæìÂÖ•ÂØÜÁ†ÅÔºàËá≥Â∞ë6‰ΩçÔºâ"
                      className={errors.password ? 'error' : ''}
                    />
                    <button
                      type="button"
                      className="password-toggle"
                      onClick={() => setShowPassword(!showPassword)}
                    >
                      {showPassword ? <EyeOff size={20} /> : <Eye size={20} />}
                    </button>
                  </div>
                  {errors.password && <span className="error-message">{errors.password}</span>}
                </div>

                <div className="form-group">
                  <label htmlFor="confirmPassword">Á°ÆËÆ§ÂØÜÁ†Å</label>
                  <div className="input-wrapper">
                    <Lock className="input-icon" size={20} />
                    <input
                      type={showConfirmPassword ? 'text' : 'password'}
                      id="confirmPassword"
                      name="confirmPassword"
                      value={formData.confirmPassword}
                      onChange={handleInputChange}
                      placeholder="ËØ∑ÂÜçÊ¨°ËæìÂÖ•ÂØÜÁ†Å"
                      className={errors.confirmPassword ? 'error' : ''}
                    />
                    <button
                      type="button"
                      className="password-toggle"
                      onClick={() => setShowConfirmPassword(!showConfirmPassword)}
                    >
                      {showConfirmPassword ? <EyeOff size={20} /> : <Eye size={20} />}
                    </button>
                  </div>
                  {errors.confirmPassword && <span className="error-message">{errors.confirmPassword}</span>}
                </div>

                <div className="form-group">
                  <label className="checkbox-label">
                    <input
                      type="checkbox"
                      name="agreeTerms"
                      checked={formData.agreeTerms}
                      onChange={handleInputChange}
                    />
                    <span className="checkbox-custom"></span>
                    ÊàëÂ∑≤ÈòÖËØªÂπ∂ÂêåÊÑè
                    <Link to="/terms" className="terms-link">ÊúçÂä°Êù°Ê¨æ</Link>
                    Âíå
                    <Link to="/privacy" className="terms-link">ÈöêÁßÅÊîøÁ≠ñ</Link>
                  </label>
                  {errors.agreeTerms && <span className="error-message">{errors.agreeTerms}</span>}
                </div>

                <button 
                  type="submit" 
                  className="btn btn-primary auth-submit"
                  disabled={isLoading}
                >
                  {isLoading ? (
                    <>
                      <div className="spinner"></div>
                      Ê≥®ÂÜå‰∏≠...
                    </>
                  ) : (
                    'ÂàõÂª∫Ë¥¶Êà∑'
                  )}
                </button>
              </form>

              <div className="auth-footer">
                <p>
                  Â∑≤ÊúâË¥¶Êà∑Ôºü
                  <Link to="/login" className="auth-link">
                    Á´ãÂç≥ÁôªÂΩï
                  </Link>
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
